css:
@-moz-document domain("fuleteo.com.co") {
html.wf-fontawesome-n4-inactive.wf-inactive body {
    background-color: #000000;
}
.box {

    background-color: #000;
}
div.datos-cancion {
    background-color: #000000;
}
span.artista {
    color: #ffffff;
}

span.titulo-cancion {
    color: #ffffff;
}

span.fecha-cancion {
    color: #ffffff;
}
html.wf-fontawesome-n4-active.wf-active body {
    background-color: #000000;
}
a.wp_rp_title {
    color: #ffffff;
}
.related-posts ul li a {
    color: #fff;
}
.tabla-mp3>tbody>tr>td, .tabla-mp3>tbody>tr>td .fa {
    color: #ffffff;
    background-color: black;
}
.tabla-mp3>tbody>tr>th {

    color: #ffffff;
   
    background-color: black;
}
.input-group .form-control:first-child, .input-group-addon:first-child, .input-group-btn:first-child>.btn, .input-group-btn:first-child>.btn-group>.btn, .input-group-btn:first-child>.dropdown-toggle, .input-group-btn:last-child>.btn-group:not(:last-child)>.btn, .input-group-btn:last-child>.btn:not(:last-child):not(.dropdown-toggle) {

    background-color: #051418;
}
.input-group-btn:last-child>.btn, .input-group-btn:last-child>.btn-group {

    background-color: #206b80;
}
input.form-control {
    color: #ffffff;
}
.navegacion {

    border-left: 1px solid #000;
    border-right: 1px solid #000;
    border-top: 1px solid #000;
}
.logo-mp3 {
    max-width: 300px;
}
.cuadro {

    border: 1px solid #206b80;
    box-shadow: 0 0 8px 0px #123d49;
    
}
.table>tbody>tr>td, .table>tbody>tr>th, .table>tfoot>tr>td, .table>tfoot>tr>th, .table>thead>tr>td, .table>thead>tr>th {
 
    border-top: 1px solid #206b80;
}

.related-posts ul li {

    border-bottom: 1px solid #248aa6;
}

.form-control {
   
    border: 1px solid #206b80;
}
.cover-mp3 img {

    background-color: #000;
    border: 1px solid #206b80;
}
    
}
